import { HeaderContainer } from "./styles";

export const Header = () => {
  return (
    <>
      <HeaderContainer>
        <h1>Sample Shopp</h1>
        <ul>
          <li>
            <button> Cadastro</button>
          </li>
          <li>
            <button> Estoque</button>
          </li>
        </ul>
      </HeaderContainer>
    </>
  );
};
